package com.example.week_6_assignment_1

import android.content.Intent
import androidx.appcompat.app.AppCompatActivity
import android.os.Bundle
import android.view.View
import android.widget.Button
import android.widget.EditText
import android.widget.Toast
import com.example.week_6_assignment_1.model.UserData
import com.example.week_6_assignment_1.model.UserList

class MainActivity : AppCompatActivity(), View.OnClickListener {
    private lateinit var etusername : EditText
    private lateinit var etpassword : EditText
    private lateinit var btnlogin : Button

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        setContentView(R.layout.activity_main)

        etusername = findViewById(R.id.etusername)
        etpassword = findViewById(R.id.etpassword)
        btnlogin = findViewById(R.id.btnlogin)
        students()
        btnlogin.setOnClickListener(this)

    }

    override fun onClick(v: View?) {
        when (v?.id){
            R.id.btnlogin->{
                if (logincheck()){
                    Toast.makeText(this, "Login Sucessfull", Toast.LENGTH_SHORT).show()
                    val intent = Intent(
                        this,
                        DashboardActivity::class.java
                    )
                    startActivity(intent)
                }
                else{
                    Toast.makeText(this, "Invalid Login", Toast.LENGTH_SHORT).show()
                }
            }
        }
    }
    fun validateInput(): Boolean {
        if (etusername.text.toString() == "") {
            etusername.setError("Please enter username")
            return false
        }
        if (etpassword.text.toString() == "") {
            etpassword.setError("Please enter password")
            return false
        }
        return true
    }
    fun logincheck(): Boolean{
        if(validateInput()){
                if (etusername.text.toString() == "softwarica" &&  etpassword.text.toString() == "coventry"){
                    return true
                }
        }
        return false
    }
    private fun students() {
        UserList.addUser(UserData("Ramesh Bhandari", 20, "Male", "Morang",
                "https://scontent.fktm8-1.fna.fbcdn.net/v/t1.0-9/52556962_2266299706985067_1735050960905961472_o.jpg?_nc_cat=106&ccb=2&_nc_sid=19026a&_nc_ohc=DK7UZwzLc3wAX-feUon&_nc_ht=scontent.fktm8-1.fna&oh=f50b98da8e85f4808e70c21025b98825&oe=6023CAEB"))
        UserList.addUser(UserData("Sabin Chapagain", 22, "Male", "Morang",
                "data:image/jpeg;base64,"))
        UserList.addUser(UserData("Sedrina Sharma", 15, "Female", "Kathmandu",
                "data:image/jpeg;base64,"))
    }
}